// 以上不進 leetcode

func largestPerimeter(A []int) int {
	maxPerimeter := 0

	sort.Sort(sort.Reverse(sort.IntSlice(A)))

	for i, a := range A {
		for j, b := range A {
			if i == j {
				continue
			}
			for k, c := range A {
				if j == k || i == k {
					continue
				}
				if !isTriangle(a, b, c) {
					continue
				}
				fmt.Printf("i=%d, j=%d, k=%d\n", i, j, k)
				return a + b + c
			}
			// if 0 != maxPerimeter {
			// 	return maxPerimeter
			// }
		}
	}

	return maxPerimeter
}

func isTriangle(a, b, c int) bool {
	if a+b <= c {
		return false
	}
	if a+c <= b {
		return false
	}
	if b+c <= a {
		return false
	}
	return true
}

func MaxInt(a, b int) int {
	if a > b {
		return a
	} else {
		return b
	}
}
